import React from "react";
import Accordion from 'react-bootstrap/Accordion';
import WorkTable from "../components/UI/Table/workTable";

function createData(name,price) {
    return { name,price };
}




function Posts() {
    return (
        <Accordion defaultActiveKey={['0']} alwaysOpen>
            <Accordion.Item eventKey="1">
                <Accordion.Header>Мотору</Accordion.Header>
                <Accordion.Body>
                    <WorkTable
                        rows ={[
                            ('Ремонт чогось', 159),
                            ('Ремонт чогось', 237),
                            ('Ремонт чогось', 262),
                            ('Ремонт чогось', 305),
                            ('Ремонт чогось', 356),
                            ('Ремонт чогось', 356),
                        ]}
                    />
                </Accordion.Body>
            </Accordion.Item>
            <Accordion.Item eventKey="2">

                <Accordion.Header>Ходової</Accordion.Header>
                <Accordion.Body>
                    <WorkTable
                        rows = {{name: 'ab чогось', price: 90}}
                    />
                </Accordion.Body>
            </Accordion.Item>

            <Accordion.Item eventKey="3">
                <Accordion.Header>Напівпричіпів</Accordion.Header>
                <Accordion.Body>

                </Accordion.Body>
            </Accordion.Item>
        </Accordion>
    );
}

export default Posts;
